			"bulletinId": "2",
			"bulletinType": "0",
			"content": "{\"description\":\"《恋世界》历尽千辛万苦终于和大家见面了（呱唧呱唧~~）\\n感谢各位大大的支持，猛虎落地谢~\\n这是《恋世界》第一次见人，还有做的不到的地方请各位海涵，\\n我们一定尽快修改，为支持我们的各位带来尽可能好的体验。\\n本次测试版本开放时间为：10月1日至10月30日\\n本次测试后我们会收集大家的意见进行修改和优化，并尽快开放后续版本~\\n欢迎大家关注微博：@恋世界--原创恋爱游戏\\n或加入QQ群：526664603\\n将意见反馈给我们，会有不定期福利发放给大家呦~\\n再次感谢大家的支持，∠(°ゝ°）敬礼~\"}",
