			"bulletinId": "6",
			"bulletinType": "1",
			"content": "{\"description\":\"小天使们~欢迎来到《恋世界》\\nHi~o(*￣▽￣*)ブ阿官知道大家初来恋世界一定有很多不熟悉的地方~~\\n那么各位小天使~~来跟阿官一起了解一下现在的功能玩法吧~~\\n\\n书架：所有的上架故事都在这里看哦~\\n\\n成就：完成成就任务可以获得相当多的奖励哦~\\n\\n图鉴：来这里给你的男神打CALL~查看男神介绍收藏男神语音~\\n\\n游乐场：来这里可以收集男神的服装及带有小故事的特殊道具哦~\\n\\n排行榜：恋世界男神打CALL排行榜，能看到男神的应援人气~\\n\\n许愿树：每3分钟会生成一个书券，书券会用来阅读故事，记得及时收获哦~\\n\\n日历：每个故事的更新日志在这里看哦~\"}",
